import React, { Component } from 'react'
import { Link } from 'react-router-dom';

export default class Logout extends Component {
    
    render() {
        return (
            <div>
                <h1>Logged out</h1>
                <Link to='/'>Login Again</Link>
            </div>
        )
    }
}
